	useEffect(() => {
		GetDataPoints();
	}, []);

	const GetDataPoints = () => {
				fetch(API + "/data/new", {
			method: 'POST',
			headers: {
			  'Accept': 'application/json',
			  'Content-Type': 'application/json',
			},
			body: JSON.stringify({
				text: 'yourValue',
				food: 13.4,
			})
		}).catch(err => console.error("Cant post"));
		fetch(API + "/data")
			.then(response => response.json())
			.then(data => setSamples(data))
			.catch(error => console.error("Error: ", error));
